import React from 'react';

const MobileMenu = ({ isMobileSite }) => {
  return isMobileSite ? (
    <div className="mt-2 absolute left-8 top-40 bg-white shadow-md rounded-lg">
      {/* Sign In */}
      <a href="/user" className="block w-20 h-6 mb-2">
        <div className="left-[30px] top-[2px] absolute text-grey-500 hover:text-green-500 text-base font-semibold leading-tight tracking-tight">
          SignIn
        </div>
      </a>
      {/* Wishlist */}
      <a href="/favorite" className="block w-24 h-6 mb-2">
        <div className="left-[32px] top-[2px] absolute text-grey-500 hover:text-green-500 text-base font-semibold leading-tight tracking-tight">
          Wishlist
        </div>
      </a>
      {/* Cart */}
      <a href="/cart" className="block w-20 h-6">
        <div className="left-[32px] top-[2px] absolute text-grey-500 hover:text-green-500 text-base font-semibold leading-tight tracking-tight">
          $12.21
        </div>
      </a>
    </div>
  ) : null;
};

export default MobileMenu;
